	display: block;
	overflow: visible;
	padding: 24px;
	position: relative;
	background-color: rgb(255, 255, 255);
	border: 1px solid rgb(230, 230, 230);
	width: 60%;	
	margin: 30 auto;
	margin-top: 30px;
`

